DELIMITER //
CREATE PROCEDURE createOrder(IN user_id_into BIGINT,in recipient_name_into varchar(50),in address_into varchar(100),in phone_number_into varchar(20))
BEGIN
    -- create a new order
    VALUES (NOW(), 0,recipient_name_into,address_into,phone_number_into,user_id_into);

    -- get the ID of the new added order
    SET @order_id = LAST_INSERT_ID();

    -- Create new order details for each item in the cart
    SELECT @order_id, ci.product_id, ci.quantity, p.price
    FROM cart_item ci
    inner join product p on p.id = ci.product_id
    WHERE user_id = user_id_into and ci.flag_deleted=false;

    -- update the quantity in the medicine table
    UPDATE product AS m
    INNER JOIN cart_item AS c ON m.id = c.product_id
    SET m.quantity = m.quantity - c.quantity
    WHERE c.user_id = user_id_into and c.flag_deleted=0;

    -- delete the items from the cart
    update cart_item
    set flag_deleted = 1
    WHERE user_id = user_id_into;
    
    select * from app_order where id = @order_id;
	
END //
DELIMITER ;